import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './nav.css';

class nav extends Component {
  render() {
    return (
      <nav> 
        <ul className="nav > ul">
          <li className="ul > li">
            <Link to="/Memory">
              <div>Memory Statistics</div>
            </Link>
          </li>
          <li className="ul > li">
            <Link to="/Latency">
              <div>Latency Statistics</div>
            </Link>
          </li>
          <li className="ul > li">
            <Link to="/Performance">
              <div>Performance Statistics</div>
            </Link>
          </li>
        </ul>
      </nav>
    );
  }
}
export default nav;
